import React from 'react';
import ReactDOM from 'react-dom';


let exampleStyle = {
  background: "skyblue",
  borderBottom: "3px solid red"
}

let element = (
  <div>
    <h1 style={exampleStyle}>hellow</h1>
  </div>
)

let classStr = 'redBg'
let element2 = (
  <div>
    <h1 className={"abc "+classStr}>hellow</h1>
  </div>
)

classStr = ['redBg','abc'].join()
let element3 = (
  <div>
    <h1 className={classStr}>hellow</h1>
  </div>
)

ReactDOM.render(
  element3,
  document.querySelector('#root')
)
